import React,{useState} from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button, Container,Paper } from '@mui/material';
import { padding } from '@mui/system';

export default function Student() {
    const [name,setName]=useState('')
    const [address,setAddress]=useState('')
  return (
      <div className='we'>
      <Container>

    <Box 
      component="form"
      sx={{
        '& > :not(style)': { m: 1 },
      }}
      noValidate
      autoComplete="off"
    >
        <h1>Student DB</h1>
      <TextField id="standard-basic" label="Student Name" variant="outlined" fullWidth value={name} onChange={(e)=>setName(e.target.value)} />
      <br></br>
      <TextField id="standard-basic" label="Student Address" variant="outlined" fullWidth  value={address} onChange={(r)=>setAddress.target.value}/>
      <br></br>
      <Button variant="contained">Submit</Button>
      {name}
      {address}
    </Box>

    </Container>
    </div>
    
  );
}
